import React from 'react';

export default function About() {
  return (
    <div className="flex flex-col items-center justify-center text-white min-h-screen bg-zinc-700 p-6">
      <div className="max-w-3xl text-center">
        <h1 className="text-4xl font-bold  md:text-5xl mb-4">
          About Us
        </h1>
        <p className="text-lg text-whi leading-relaxed md:text-xl">
          Welcome to our website! We are dedicated to providing you with the best experience and value.
          Our team works tirelessly to deliver exceptional products and services tailored to meet your needs.
          We believe in innovation, integrity, and commitment to quality, ensuring that you always receive
          top-notch service. Thank you for being a part of our journey.
        </p>
      </div>
    </div>
  );
}
